                new Dictionary<int, string> { { 0, "agora" } },
                new Dictionary<PluralRulesValues, string> { { PluralRulesValues.Other, "a ten {0} sig" } },
                new Dictionary<PluralRulesValues, string> { { PluralRulesValues.Other, "di li {0} sig" } }));

